using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;

using Android.App;
using Android.Content;
using Android.OS;
using Android.Runtime;
using Android.Views;
using Android.Widget;
using Newtonsoft.Json;

namespace Exercise_2.Models
{
    public class ListOrders 
    {
        public List<Order> Orders { get; set; }

        private static readonly List<Order> BuildInListOrders = new List<Order>()
        {
            new Order()
            {
                Product = new Product()
                {
                    Name = "Product 1",
                    ImageString = "data:image/jpeg;base64,",
                    PricePerUnit = 10,
                    Unit = "1kg",
                },
                Quantity = 0
            },
            new Order()
            {
                Product = new Product()
                {
                    Name = "Product 2",
                    ImageString = "data:image/jpeg;base64,",
                    PricePerUnit = 20,
                    Unit = "500gram",
                },
                Quantity = 0
            }
        };

        public ListOrders()
        {
            Orders = BuildInListOrders;
        }

        public List<T> ReadJson<T>()
        {
            var stream = Application.Context.Assets.Open($"{typeof(T).Name}s.json");
            var streamReader = new StreamReader(stream);
            var content = streamReader.ReadToEnd();
            return JsonConvert.DeserializeObject<List<T>>(content);
        }

        public double SumOfPrices => Orders.Sum(x => x.Quantity * x.Product.PricePerUnit);

        public Order this[int i] => Orders[i];

        public int NumberOfOrders => Orders.Count;
    }
}